'use strict';
let MessageType = require('./MessageType.js');
//@@DocBrief("The class for getting temporary price session messages")
class GetTemporaryPriceSessionMessage {
    temporarySession;
    error;
    requestId;
    constructor() {
        this.temporarySession = null;
        this.error = null;
        this.requestId = "";
    }
    getTemporaryPriceSession() {
        return this.temporarySession;
    }
    getError() {
        return this.error;
    }
    getType() {
        return MessageType.GetTemporaryPriceSession;
    }
    getRequestId() {
        return this.requestId;
    }
}
module.exports = GetTemporaryPriceSessionMessage
